  \"precipitation-frequency-for-semiarid-southwest-usa-noaa-atlas-14-volume-1\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This GIS grid atlas contains precipitation
  frequency estimates for the Semiarid Southwest based on precipitation data collected
  between 1893-2000. This atlas is an updated version of volumes IV (New Mexico),
  VI (Utah), VII Nevada), VIII (Arizona), published in 1973. The grids provide information
  for durations from 5 minutes through 60 days, and for return periods of 1 year through
  1000 years. The grid data also contains estimates for California from NOAA Atlas
  14 Volume 6 Version 2. Please see the metadata page for the California portion of
  the grid.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
